import React from 'react'
import styled from 'styled-components'

const CardPais = ({key, flag, name, continent}) => {
  return (
    <CardContainer>
      <CardRender id={key}>
        <div>
          <img src={flag} alt="flag" />
        </div>
        <section>
          <h1>{name}</h1>
          <p>{continent}</p>
        </section>
      </CardRender>
    </CardContainer>
  )
}

export default CardPais



const CardContainer = styled.main`
  
`

const CardRender = styled.div`
  display: flex;
  section {
    display: flex;
    flex-direction: column;
    justify-content: space-evenly;
    text-align: center;
  }
  div img {
    width: 30rem;
    height: 30rem;
    object-fit: cover;
  }

`
